#![cfg_attr(not(debug_assertions), windows_subsystem = "windows")]

use cpal::{
    traits::{DeviceTrait, HostTrait, StreamTrait},
    Stream,
};
use once_cell::sync::OnceCell;
use rand::Rng;
use serde_derive::Serialize;
use std::sync::{Arc, Mutex};
use tauri::Emitter;

type Sample = f32;

enum PttState {
    Idle,
    Recording(Arc<Mutex<Vec<Sample>>>, Stream),
    Playing(Arc<Mutex<Vec<Sample>>>, Stream),
}

impl core::fmt::Debug for PttState {
    fn fmt(&self, f: &mut core::fmt::Formatter<'_>) -> core::fmt::Result {
        match self {
            Self::Idle => f.debug_struct("PttState::Idle").finish(),
            Self::Recording(..) => f.debug_struct("PttState::Recording").finish(),
            Self::Playing(..) => f.debug_struct("PttState::Playing").finish(),
        }
    }
}

// The streams are not safe to use across threads, but they're never actually used.  We just hold
// them to keep them alive.
unsafe impl Send for PttState {}
unsafe impl Sync for PttState {}

struct AppState {
    ptt_state: PttState,
}

impl core::fmt::Debug for AppState {
    fn fmt(&self, f: &mut core::fmt::Formatter<'_>) -> core::fmt::Result {
        f.write_str("AppState")
    }
}

#[derive(Clone, Serialize)]
struct ScreenCommand<'a> {
    left: usize,
    top: usize,
    width: usize,
    height: usize,
    data: &'a [u8],
}

const SCREEN_WIDTH: usize = 320;
const SCREEN_HEIGHT: usize = 240;

impl AppState {
    fn new() -> Self {
        Self {
            ptt_state: PttState::Idle,
        }
    }

    fn draw_splash_screen(&self) {
        println!("draw_splash_screen");
        let app = APP_HANDLE.get().unwrap();

        let cmd = ScreenCommand {
            left: 0,
            top: 0,
            width: SCREEN_WIDTH,
            height: SCREEN_HEIGHT,
            data: HACTAR_VAPORWAVE,
        };

        app.emit("Screen", cmd).unwrap();
    }

    fn draw_random_rectangle(&self) {
        println!("draw_splash_screen");
        let app = APP_HANDLE.get().unwrap();

        const WIDTH: usize = 20;
        const HEIGHT: usize = 20;

        let mut rgba = [0xff; 4 * WIDTH * HEIGHT];
        let mut rng = rand::rng();
        let (r, g, b): (u8, u8, u8) = rng.random();
        for pixel in rgba.chunks_mut(4) {
            pixel[0] = r;
            pixel[1] = g;
            pixel[2] = b;
        }

        let left = rng.random_range(0..SCREEN_WIDTH);
        let top = rng.random_range(0..SCREEN_HEIGHT);

        let cmd = ScreenCommand {
            left,
            top,
            width: WIDTH,
            height: HEIGHT,
            data: &rgba,
        };

        app.emit("Screen", cmd).unwrap();
    }

    fn start_transmit(&mut self) {
        println!("start_transmit");
        let app = APP_HANDLE.get().unwrap();

        let PttState::Idle = self.ptt_state else {
            println!("Invalid state: {:?}", self.ptt_state);
            unreachable!();
        };

        let storage = Arc::new(Mutex::new(Vec::<f32>::new()));
        let storage_clone = storage.clone();

        let data_fn = move |data: &[f32], _: &cpal::InputCallbackInfo| {
            let mut storage = storage_clone.lock().unwrap();
            storage.extend_from_slice(data);
        };

        let err_fn = move |err| {
            eprintln!("an error occurred on stream: {}", err);
        };

        let host = cpal::default_host();
        let input_device = host.default_input_device().unwrap();
        let config = input_device.default_input_config().unwrap();
        let input_stream = input_device
            .build_input_stream(&config.into(), data_fn, err_fn, None)
            .unwrap();

        input_stream.play().unwrap();

        app.emit::<&str>("PttState", "Recording").unwrap();
        self.ptt_state = PttState::Recording(storage, input_stream)
    }

    fn stop_transmit(&mut self) {
        println!("Stop transmit");
        self.start_play();
    }

    fn start_play(&mut self) {
        println!("Start play");
        let app = APP_HANDLE.get().unwrap();

        let PttState::Recording(storage, input_stream) = &mut self.ptt_state else {
            println!("Invalid state: {:?}", self.ptt_state);
            unreachable!();
        };

        // Stop the stream so that we can take the storage.  It will get cleaned up at the
        // end of this method.
        input_stream.pause().unwrap();

        let storage = storage.clone();
        let storage_clone = storage.clone();
        let data_fn = move |data: &mut [f32], _: &cpal::OutputCallbackInfo| {
            let mut storage = storage_clone.lock().unwrap();

            let len = core::cmp::min(data.len() / 2, storage.len());
            let stereo = storage
                .iter()
                .take(len)
                .map(|x| [x, x])
                .flatten()
                .enumerate();
            for (i, sample) in stereo {
                data[i] = *sample;
            }

            data[(2 * len)..].fill(0.);
            *storage = storage.split_off(len);

            if storage.is_empty() {
                std::thread::spawn(ptt_play_done_cb);
            }
        };

        let err_fn = move |err| {
            eprintln!("an error occurred on stream: {}", err);
        };

        let host = cpal::default_host();
        let output_device = host.default_output_device().unwrap();
        let config = output_device.default_output_config().unwrap();
        let output_stream = output_device
            .build_output_stream(&config.into(), data_fn, err_fn, None)
            .unwrap();

        output_stream.play().unwrap();

        app.emit::<&str>("PttState", "Playing").unwrap();
        self.ptt_state = PttState::Playing(storage, output_stream);
    }

    fn return_to_idle(&mut self) {
        println!("Return to idle");
        let app = APP_HANDLE.get().unwrap();

        self.ptt_state = match &mut self.ptt_state {
            PttState::Playing(_storage, output_stream) => {
                // Stop the stream so that we shut down gracefully.
                output_stream.pause().unwrap();

                app.emit::<&str>("PttState", "Idle").unwrap();
                PttState::Idle
            }

            _ => unreachable!(),
        };
    }
}

static STATE: OnceCell<Mutex<AppState>> = OnceCell::new();
static APP_HANDLE: OnceCell<tauri::AppHandle> = OnceCell::new();

fn ptt_play_done_cb() {
    let mut state = STATE.get().unwrap().lock().unwrap();
    state.return_to_idle();
}

#[tauri::command]
fn start() {
    println!("Start");
    let state = STATE.get().unwrap().lock().unwrap();
    state.draw_splash_screen();
}

#[tauri::command]
fn ptt_button_press(name: &str) {
    println!("PTT button event: {}", name);
    let mut state = STATE.get().unwrap().lock().unwrap();
    match name {
        "mousedown" => state.start_transmit(),
        "mouseup" => state.stop_transmit(),
        _ => state.return_to_idle(),
    }
}

#[tauri::command]
fn ai_button_press(name: &str) {
    // TODO
    println!("AI button press");
    let state = STATE.get().unwrap().lock().unwrap();
    match name {
        "mousedown" => state.draw_random_rectangle(),
        _ => {}
    }
}

#[tauri::command]
fn keydown(code: &str) {
    // TODO actually handle
    println!("keydown: {}", code);
}

#[tauri::command]
fn keyup(code: &str) {
    // TODO actually handle
    println!("keyup: {}", code);
}

#[cfg_attr(mobile, tauri::mobile_entry_point)]
pub fn run() {
    tauri::Builder::default()
        .setup(|app| {
            APP_HANDLE.set(app.handle().clone()).unwrap();
            STATE.set(Mutex::new(AppState::new())).unwrap();
            Ok(())
        })
        .invoke_handler(tauri::generate_handler![
            start,
            ai_button_press,
            ptt_button_press,
            keydown,
            keyup
        ])
        .run(tauri::generate_context!())
        .expect("error while running tauri application");
}

